column.Comment:
18 - Indicativo de Prestao de Servios em Obra de Construo Civil:
0 - No  obra de construo civil ou no est sujeita a matrcula de obra;
1 - Obra de Construo Civil - Empreitada Total;
2 - Obra de Construo Civil - Empreitada Parcial.
Validao: Em arquivo gerado por Pessoa Fsica, deve ser igual a [1,2].
Valores Vlidos: 0, 1, 2

